/*Table structure for table `votemap` */

DROP TABLE IF EXISTS `votemap`;

CREATE TABLE `votemap` (
  `vid` varchar(100) NOT NULL,
  `asker` varchar(100) DEFAULT NULL,
  `user` varchar(100) NOT NULL,
  `status` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`vid`,`user`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `votemap` */

/*Table structure for table `votequery` */

DROP TABLE IF EXISTS `votequery`;

CREATE TABLE `votequery` (
  `vid` int(11) NOT NULL AUTO_INCREMENT,
  `query` varchar(1000) DEFAULT NULL,
  `latent` varchar(100) DEFAULT NULL,
  `uemail` varchar(100) DEFAULT NULL,
  `uname` varchar(100) DEFAULT NULL,
  `status` varchar(100) DEFAULT 'new',
  PRIMARY KEY (`vid`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;

/*Data for the table `votequery` */

