/*Table structure for table `votes` */

DROP TABLE IF EXISTS `votes`;

CREATE TABLE `votes` (
  `vid` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `latent` varchar(100) DEFAULT NULL,
